  false,\n\t\"url\": null,\n\t\"notes\": \"This project is a cooperative effort between
  the National Ocean Service, National Centers for Coastal Ocean Science, Center for
  Coastal Monitoring and Assessment, the University of Hawaii, BAE Systems Spectral
  Solutions and Analytical Laboratories of Hawaii, LLC. The goal of the work was to
  map the coral reef habitats of American Samoa, Guam and the Common Wealth of the
  Northern Mariana Islands by visual interpretation and manual delineation of IKONOS
  satellite imagery. A two tiered habitat classification system was tested and implemented
  in this work. It integrates geomorphologic reef structure and biological cover into
  a single scheme and subsets each into detail. It also includes thirteen zones. Benthic
  features were mapped that covered an area of 45.2 square kilometers of which 4.4
  were unconsolidated sediment and 40.9 were coral reef and hard bottom. Of the coral
  reef and hard bottom class, 59.9% is colonized by greater than 10% coral cover.\",\n\t\"license_title\":
